import React from 'react'

export const dateItem = (props) => {
    return (
        <button className="dateItem" active="true" disable="" >
            <div className="info">
                <span className="day">{props.item.day}</span>
                <span className="date">{props.item.date}</span>
            </div>
        </button>
    )
}

export const calendarData = [
    {
        day: "SEN",
        date: 11,
        active: "",
        disable: "",
    },
]
